//github.com/solana-labs/wallet-standard/blob/master/packages/core/chains/src/index.ts\n",e+="\n",e+='sol-chain-id    = sol-namespace ":" sol-network-id\n',e+="                ; Examples:\n",e+="                ; - solana:mainnet (solana mainnet)\n",e+="                ; - solana:testnet (solana testnet)\n",e+="; ==============================================================================\n",e+="; Chain-agnostic account identifiers (CAIP-10)\n",e+="; ==============================================================================\n",e+=";\n",e+="; Requires:\n",e+="; - core.bnf\n",e+="; - chain-id.bnf\n",e+=";\n",e+="; References:\n",e+="; - https://github.com/ChainAgnostic/CAIPs/blob/master/CAIPs/caip-2.md#syntax\n",e+="; - https://github.com/ChainAgnostic/CAIPs/blob/master/CAIPs/caip-10.md#syntax\n",e+="\n",e+="account-id      = eth-account-id\n",e+="                / sol-account-id\n",e+="                ; NOTE: Only Ethereum and Solana are supported at the moment\n",e+="\n",e+="; Ethereum\n",e+="; ------------------------------------------------------------------------------\n",e+="\n",e+='eth-address     = "0x" 40HEXDIG\n',e+="                ; Must also conform to captilization\n",e+="                ; checksum encoding specified in EIP-55\n",e+="                ; where applicable (EOAs).\n",e+="\n",e+='eth-account-id  = eth-chain-id ":" eth-address\n',e+='                ; See CAIP-2 for definition of "eth-chain-id"\n',e+="                ; Examples:\n",e+="                ; - eip155:1:0xb9c5714089478a327f09197987f16f9e5d936e8a   (eth mainnet)\n",e+="                ; - eip155:137:0xb9c5714089478a327f09197987f16f9e5d936e8a (polygon mainnet)\n",e+="\n",e+="; Solana\n",e+="; ------------------------------------------------------------------------------\n",e+="\n",e+="sol-address     = 32*44( %x31-39 / %x41-48 / %x4A-4E / %x50-5A / %x61-6B / %x6D-7A )\n",e+="                ; Valid Solana addresses are 32-44 base58-encoded chars: 1-9 / A-H / J-N / P-Z / a-k / m-z\n",e+='                ; Note: this doesn\'t validate whether the address is "on the curve"\n',e+="\n",e+='sol-account-id  = sol-chain-id ":" sol-address\n',e+='                ; See CAIP-2 for definition of "sol-chain-id"\n',e+="                ; Examples:\n",e+="                ; - solana:mainnet:FYpB58cLw5cwiN763ayB2sFT8HLF2MRUBbbyRgHYiRpK (solana mainnet)\n",e+="                ; - solana:testnet:QhnBSSbjScn9VHBBqwosy99icpeJrW4iuEwkJ3d9Fn9  (solana testnet)\n",e+="; ==============================================================================\n",e+="; Sign in with X (CAIP-122)\n",e+="; ==============================================================================\n",e+=";\n",e+="; Requires:\n",e+="; - core.bnf\n",e+="; - datetime.bnf\n",e+="; - uri.bnf\n",e+="; - dns.bnf\n",e+="; - chain-id.bnf\n",e+="; - account-id.bnf\n",e+=";\n",e+="; References:\n",e+="; - https://github.com/ChainAgnostic/CAIPs/blob/master/CAIPs/caip-2.md#syntax\n",e+="; - https://github.com/ChainAgnostic/CAIPs/blob/master/CAIPs/caip-10.md#syntax\n",e+="; - https://github.com/ChainAgnostic/CAIPs/blob/master/CAIPs/caip-122.md\n",e+=";\n",e+="; Note:\n",e+="; Currently, this grammar file only supports the Ethereum and Solana blockchains\n",e+="\n",e+="sign-in-with-x = sign-in-with-eth\n",e+="               / sign-in-with-sol\n",e+="\n",e+="; Ethereum\n",e+=";-----------------------------------------------------------------------------\n",e+="\n",e+="sign-in-with-eth =\n",e+='  message-domain %s" wants you to sign in with your Ethereum account:" LF\n',e+="  eth-account-id LF\n",e+="  LF\n",e+="  [ message-statement LF ]\n",e+="  LF\n",e+='  %s"URI: " message-uri LF\n',e+='  %s"Version: " message-version LF\n',e+='  %s"Chain ID: " eth-chain-id LF\n',e+='  %s"Nonce: " message-nonce LF\n',e+='  %s"Issued At: " message-issued-at\n',e+='  [ LF %s"Expiration Time: " message-expiration-time ]\n',e+='  [ LF %s"Not Before: " message-not-before ]\n',e+='  [ LF %s"Request ID: " message-request-id ]\n',e+='  [ LF %s"Resources:" message-resources ]\n',e+="\n",e+="; Solana\n",e+=";-----------------------------------------------------------------------------\n",e+="\n",e+="sign-in-with-sol =\n",e+='  message-domain %s" wants you to sign in with your Solana account:" LF\n',e+="  sol-account-id LF\n",e+="  LF\n",e+="  [ message-statement LF ]\n",e+="  LF\n",e+='  %s"URI: " message-uri LF\n',e+='  %s"Version: " message-version LF\n',e+='  %s"Chain ID: " sol-chain-id LF\n',e+='  %s"Nonce: " message-nonce LF\n',e+='  %s"Issued At: " message-issued-at\n',e+='  [ LF %s"Expiration Time: " message-expiration-time ]\n',e+='  [ LF %s"Not Before: " message-not-before ]\n',e+='  [ LF %s"Request ID: " message-request-id ]\n',e+='  [ LF %s"Resources:" message-resources ]\n',e+="\n",e+="; Common\n",e+=";-----------------------------------------------------------------------------\n",e+="\n",e+="message-domain          = dnsauthority ; CAIP-10 spec defines domain as dnsauthority unlike EIP-4361, which uses authority\n",e+="message-address         = eth-account-id / sol-account-id ; See CAIP-10 for address identifier definition\n",e+='message-statement       = 1*( reserved / unreserved / " " )\n',e+="message-uri             = URI\n",e+='message-version         = "1"\n',e+="message-chain-id        = eth-chain-id / sol-chain-id\n",e+="message-nonce           = 8*( ALPHA / DIGIT )\n",e+="message-issued-at       = date-time\n",e+="message-expiration-time = date-time\n",e+="message-not-before      = date-time\n",e+="message-request-id      = *pchar\n",e+='message-resources       = *( LF "- " URI )\n','; ==============================================================================\n; Core rules for ABNF (RFC 5234)\n; ==============================================================================\n;\n; References:\n; - https://www.rfc-editor.org/rfc/rfc5234#appendix-B.1\n\nALPHA          =  %x41-5A / %x61-7A\n               ; A-Z / a-z\n\nBIT            =  "0" / "1"\n\nCHAR           =  %x01-7F\n               ; any 7-bit US-ASCII character,\n               ;  excluding NUL\n\nCR             =  %x0D\n               ; carriage return\n\nCRLF           =  CR LF\n               ; Internet standard newline\n\nCTL            =  %x00-1F / %x7F\n               ; controls\n\nDIGIT          =  %x30-39\n               ; 0-9\n\nDQUOTE         =  %x22\n               ; " (Double Quote)\n\nHEXDIG         =  DIGIT / "A" / "B" / "C" / "D" / "E" / "F"\n\nHTAB           =  %x09\n               ; horizontal tab\n\nLF             =  %x0A\n               ; linefeed\n\nLWSP           =  *(WSP / CRLF WSP)\n               ; Use of this linear-white-space rule\n               ;  permits lines containing only white\n               ;  space that are no longer legal in\n               ;  mail headers and have caused\n               ;  interoperability problems in other\n               ;  contexts.\n               ; Do not use when defining mail\n               ;  headers and use with caution in\n               ;  other contexts.\n\nOCTET          =  %x00-FF\n               ; 8 bits of data\n\nSP             =  %x20\n\nVCHAR          =  %x21-7E\n               ; visible (printing) characters\n\nWSP            =  SP / HTAB\n               ; white space\n; ==============================================================================\n; Internet Date/Time Format (RFC 3339)\n; ==============================================================================\n;\n; Requires:\n; - core.bnf\n;\n; References:\n; - https://www.rfc-editor.org/rfc/rfc3339#section-5.6\n\ndate-fullyear   = 4DIGIT\n\ndate-month      = 2DIGIT  ; 01-12\n\ndate-mday       = 2DIGIT  ; 01-28, 01-29, 01-30, 01-31 based on\n                          ; month/year\n\ntime-hour       = 2DIGIT  ; 00-23\n\ntime-minute     = 2DIGIT  ; 00-59\n\ntime-second     = 2DIGIT  ; 00-58, 00-59, 00-60 based on leap second\n                          ; rules\n\ntime-secfrac    = "." 1*DIGIT\n\ntime-numoffset  = ("+" / "-") time-hour ":" time-minute\n\ntime-offset     = "Z" / time-numoffset\n\npartial-time    = time-hour ":" time-minute ":" time-second\n                  [time-secfrac]\n\nfull-date       = date-fullyear "-" date-month "-" date-mday\n\nfull-time       = partial-time time-offset\n\ndate-time       = full-date "T" full-time\n; ==============================================================================\n; Uniform Resource Identifier (RFC 3986)\n; ==============================================================================\n;\n; Requires:\n; - core.bnf\n;\n; References:\n; - https://www.rfc-editor.org/rfc/rfc3986#appendix-A\n\nURI           = scheme ":" hier-part [ "?" query ] [ "#" fragment ]\n\nhier-part     = "//" authority path-abempty\n              / path-absolute\n              / path-rootless\n              / path-empty\n\nURI-reference = URI / relative-ref\n\nabsolute-URI  = scheme ":" hier-part [ "?" query ]\n\nrelative-ref  = relative-part [ "?" query ] [ "#" fragment ]\n\nrelative-part = "//" authority path-abempty\n              / path-absolute\n              / path-noscheme\n              / path-empty\n\nscheme        = ALPHA *( ALPHA / DIGIT / "+" / "-" / "." )\n\nauthority     = [ userinfo "@" ] host [ ":" port ]\nuserinfo      = *( unreserved / pct-encoded / sub-delims / ":" )\nhost          = IP-literal / IPv4address / reg-name\nport          = *DIGIT\n\nIP-literal    = "[" ( IPv6address / IPvFuture  ) "]"\n\nIPvFuture     = "v" 1*HEXDIG "." 1*( unreserved / sub-delims / ":" )\n\nIPv6address   =                            6( h16 ":" ) ls32\n              /                       "::" 5( h16 ":" ) ls32\n              / [               h16 ] "::" 4( h16 ":" ) ls32\n              / [ *1( h16 ":" ) h16 ] "::" 3( h16 ":" ) ls32\n              / [ *2( h16 ":" ) h16 ] "::" 2( h16 ":" ) ls32\n              / [ *3( h16 ":" ) h16 ] "::"    h16 ":"   ls32\n              / [ *4( h16 ":" ) h16 ] "::"              ls32\n              / [ *5( h16 ":" ) h16 ] "::"              h16\n              / [ *6( h16 ":" ) h16 ] "::"\n\nh16           = 1*4HEXDIG\nls32          = ( h16 ":" h16 ) / IPv4address\nIPv4address   = dec-octet "." dec-octet "." dec-octet "." dec-octet\ndec-octet     = DIGIT                 ; 0-9\n              / %x31-39 DIGIT         ; 10-99\n              / "1" 2DIGIT            ; 100-199\n              / "2" %x30-34 DIGIT     ; 200-249\n              / "25" %x30-35          ; 250-255\n\nreg-name      = *( unreserved / pct-encoded / sub-delims )\n\npath          = path-abempty    ; begins with "/" or is empty\n              / path-absolute   ; begins with "/" but not "//"\n              / path-noscheme   ; begins with a non-colon segment\n              / path-rootless   ; begins with a segment\n              / path-empty      ; zero characters\n\npath-abempty  = *( "/" segment )\npath-absolute = "/" [ segment-nz *( "/" segment ) ]\npath-noscheme = segment-nz-nc *( "/" segment )\npath-rootless = segment-nz *( "/" segment )\npath-empty    = 0pchar\n\nsegment       = *pchar\nsegment-nz    = 1*pchar\nsegment-nz-nc = 1*( unreserved / pct-encoded / sub-delims / "@" )\n; non-zero-length segment without any colon ":"\n\npchar         = unreserved / pct-encoded / sub-delims / ":" / "@"\n\nquery         = *( pchar / "/" / "?" )\n\nfragment      = *( pchar / "/" / "?" )\n\npct-encoded   = "%" HEXDIG HEXDIG\n\nunreserved    = ALPHA / DIGIT / "-" / "." / "_" / "~"\nreserved      = gen-delims / sub-delims\ngen-delims    = ":" / "/" / "?" / "#" / "[" / "]" / "@"\nsub-delims    = "!" / "$" / "&" / "\'" / "(" / ")"\n              / "*" / "+" / "," / ";" / "="\n; ==============================================================================\n; DNS URI (RFC 4501)\n; ==============================================================================\n;\n; Requires:\n; - core.bnf\n; - uri.bnf\n;\n; References:\n; - https://www.rfc-editor.org/rfc/rfc4501.html#section-3\n;\n; Note:\n; dnsclassval and dnstypeval are not defined exhaustively\n; but their definitions are unused in SIW grammars.\n\n\ndnsurl          = "dns:" [ "//" dnsauthority "/" ]\n                  dnsname ["?" dnsquery]\n\ndnsauthority    = host [ ":" port ]\n                ; See RFC 3986 for the\n                ; definition of "host" and "port".\n\ndnsname         = *pchar\n                ; See RFC 3986 for the\n                ; definition of "pchar".\n\n                ; The "dnsname" field may be a\n                ; "relative" or "absolute" name,\n                ; as per RFC 1034, section 3.1.\n\n                ; Note further that an empty\n                ; "dnsname" value is to be\n                ; interpreted as the root itself.\n                ; See below on relative dnsnames.\n\ndnsquery        = dnsqueryelement [";" dnsquery]\n\ndnsqueryelement = ( "CLASS=" dnsclassval ) / ( "TYPE=" dnstypeval )\n                ; Each clause MUST NOT be used more\n                ; than once.\n\ndnsclassval     = 1*digit / "IN" / "CH"\n                ; omitted:\n                ; / <Any IANA registered DNS class mnemonic>\n\ndnstypeval      = 1*digit / "A" / "NS" / "MD"\n                ; omitted:\n                ; / <Any IANA registered DNS type mnemonic>\n; ==============================================================================\n; Chain-agnostic IDs (CAIP-2)\n; ==============================================================================\n;\n; Requires:\n; - core.bnf\n;\n; References:\n; - https://github.com/ChainAgnostic/CAIPs/blob/master/CAIPs/caip-2.md#syntax\n; - https://github.com/ChainAgnostic/CAIPs/blob/master/CAIPs/caip-10.md#syntax\n\nchain-id        = eth-chain-id\n                / sol-chain-id\n                ; NOTE: Only Ethereum and Solana are supported at the moment\n\n\n; Ethereum\n; ------------------------------------------------------------------------------\n\neth-namespace   = %s"eip155"\n                ; The chain-id namespace for evm chains\n\neth-network-id  = 1*32DIGIT\n                ; Accept up to 32 digits. Could probably be lowered\n\neth-chain-id    = eth-namespace ":" eth-network-id\n                ; Examples:\n                ; - eip155:1   (eth mainnet)\n                ; - eip155:137 (polygon mainnet)\n\n; Solana\n; ------------------------------------------------------------------------------\n\nsol-namespace   = %s"solana"\n                ; The chain-id namespace for solana\n\nsol-network-id  = %s"mainnet" / %s"testnet" / %s"devnet" / %s"localnet"\n                ; This enumeration comes from https://github.com/solana-labs/wallet-standard/blob/master/packages/core/chains/src/index.ts\n\nsol-chain-id    = sol-namespace ":" sol-network-id\n                ; Examples:\n                ; - solana:mainnet (solana mainnet)\n                ; - solana:testnet (solana testnet)\n; ==============================================================================\n; Chain-agnostic account identifiers (CAIP-10)\n; ==============================================================================\n;\n; Requires:\n; - core.bnf\n; - chain-id.bnf\n;\n; References:\n; - https://github.com/ChainAgnostic/CAIPs/blob/master/CAIPs/caip-2.md#syntax\n; - https://github.com/ChainAgnostic/CAIPs/blob/master/CAIPs/caip-10.md#syntax\n\naccount-id      = eth-account-id\n                / sol-account-id\n                ; NOTE: Only Ethereum and Solana are supported at the moment\n\n; Ethereum\n; ------------------------------------------------------------------------------\n\neth-address     = "0x" 40HEXDIG\n                ; Must also conform to captilization\n                ; checksum encoding specified in EIP-55\n                ; where applicable (EOAs).\n\neth-account-id  = eth-chain-id ":" eth-address\n                ; See CAIP-2 for definition of "eth-chain-id"\n                ; Examples:\n                ; - eip155:1:0xb9c5714089478a327f09197987f16f9e5d936e8a   (eth mainnet)\n                ; - eip155:137:0xb9c5714089478a327f09197987f16f9e5d936e8a (polygon mainnet)\n\n; Solana\n;